import uuid from "react-uuid";
const ShipList = [
  {
    Name: "Starter Ship",
    Population: 1000,
    Description: "This is the starting ship",
    Img: "https://w7.pngwing.com/pngs/225/630/png-transparent-red-spaceship-rocket-icon-rocket-image-file-formats-cartoon-rocket-launch.png",
    PlanetOn: "Mercury",
    key: uuid(),
  },
  {
    Name: "Starter Ship2",
    Population: 1000,
    Description: "This is the starting ship",
    Img: "https://w7.pngwing.com/pngs/225/630/png-transparent-red-spaceship-rocket-icon-rocket-image-file-formats-cartoon-rocket-launch.png",
    PlanetOn: "Venus",
    key: uuid(),
  },
];
export default ShipList;
